import React from "react";
import resume from "../assets/current_resume.pdf"
import {
    ResumeContainer,
    ResumeIframe
} from "./PageElements";
const Resume = () => {
    return(
    <ResumeContainer>
        <ResumeIframe src={resume}></ResumeIframe>
    </ResumeContainer>);
}

export default Resume;
